import re

def iso8601_duration_to_hours(duration):
	# Regular expression to parse ISO 8601 duration format
	pattern = r'P(?:(\d+)D)?(?:T(?:(\d+)H)?)?'
	match = re.match(pattern, duration)

	if not match:
	    raise ValueError("Invalid ISO 8601 duration format: {}".format(duration))

	# Extract days and hours, defaulting to 0 if not present
	days = int(match.group(1)) if match.group(1) else 0
	hours = int(match.group(2)) if match.group(2) else 0

	# Convert to total hours
	total_hours = days * 24 + hours
	return total_hours

